import React from 'react'
import { Col, Row } from 'react-bootstrap'
import Products from '../products'
const HomeScreen = () => {
  return (
    <>
         <h1>Latest Products</h1>
         <Row>
             {Products.map((product)=>{
                <Col sm={12} md={6} lg={4} xl={3}>
                <h2>{product.name}</h2>
                </Col>
             })}
         </Row>
    </>
  )
}

export default HomeScreen
